import React from 'react'
import { WorkCardContainer, WorkDesc, WorkLinks, WorkLink, WorkTitle } from './MyWork.elements';

function WorkCard({image, title, description, links}) {

  

  return (
      <WorkCardContainer style={{backgroundImage: `url(${image})`}}>
        <WorkTitle>{title}</WorkTitle>
        <div>
        <WorkDesc>
          {description}
        </WorkDesc>
        <WorkLinks>
          <WorkLink href={links.siteLink} target='_blank'>Live Site</WorkLink>
          <WorkLink href={links.githubLink} target='_blank'>View Code</WorkLink>
        </WorkLinks>
        </div>
      </WorkCardContainer>
    )
  
}



export default WorkCard
